import React, { useState, useContext } from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  InputBase,
  Box,
  Menu,
  MenuItem,
  ListItemIcon,
  ListItemText,
} from "@mui/material";
import { 
  Menu as MenuIcon, 
  Search, 
  AccountCircle, 
  Logout, 
  Bookmarks, 
  Person, 
  SmartToy, 
  Login,
  Dashboard 
} from "@mui/icons-material";
import { useNavigate } from "react-router-dom";
import { AuthContext } from "../context/AuthContext";

const Header = ({ toggleSidebar }) => {
  const [searchQuery, setSearchQuery] = useState("");
  const [anchorEl, setAnchorEl] = useState(null);
  const { userRole, setUserRole } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleSearch = (event) => {
    setSearchQuery(event.target.value);
    // Optionally, implement search logic here.
  };

  const handleProfileClick = (event) => {
    if (userRole) {
      setAnchorEl(event.currentTarget);
    } else {
      navigate("/login");
    }
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    handleClose();
    sessionStorage.clear();
    localStorage.clear();
    setUserRole(null);
    navigate("/login");
  };

  return (
    <AppBar position="fixed" sx={{ backgroundColor: "#e65100", zIndex: 1201 }}>
      <Toolbar>
        <IconButton edge="start" color="inherit" aria-label="menu" onClick={toggleSidebar} sx={{ mr: 2 }}>
          <MenuIcon />
        </IconButton>

        <Typography variant="h6" sx={{ flexGrow: 1, fontWeight: "bold" }}>
          {userRole === "ADMIN" ? "Admin Dashboard" : "AptitudeArc"}
        </Typography>

        <Box sx={{ display: "flex", alignItems: "center", backgroundColor: "#ffffff33", borderRadius: 1, px: 2, py: 0.5 }}>
          <Search sx={{ color: "#fff" }} />
          <InputBase placeholder="Search..." value={searchQuery} onChange={handleSearch} sx={{ ml: 1, color: "#fff" }} />
        </Box>

        <IconButton color="inherit" sx={{ ml: 2 }} onClick={handleProfileClick}>
          {userRole ? <AccountCircle /> : <Login />}
        </IconButton>

        {userRole && (
          <Menu anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={handleClose}>
            {userRole === "ADMIN" ? (
              <MenuItem onClick={() => navigate("/admin")}>
                <ListItemIcon>
                  <Dashboard fontSize="small" />
                </ListItemIcon>
                <ListItemText primary="Admin Dashboard" />
              </MenuItem>
            ) : (
              <>
                <MenuItem onClick={() => navigate("/user/profile")}>
                  <ListItemIcon>
                    <Person fontSize="small" />
                  </ListItemIcon>
                  <ListItemText primary="Profile Page" />
                </MenuItem>
                <MenuItem onClick={() => navigate("/ai")}>
                  <ListItemIcon>
                    <SmartToy fontSize="small" />
                  </ListItemIcon>
                  <ListItemText primary="AI" />
                </MenuItem>
                <MenuItem onClick={() => navigate("/bookmarks")}>
                  <ListItemIcon>
                    <Bookmarks fontSize="small" />
                  </ListItemIcon>
                  <ListItemText primary="Bookmark Page" />
                </MenuItem>
              </>
            )}
            <MenuItem onClick={handleLogout}>
              <ListItemIcon>
                <Logout fontSize="small" />
              </ListItemIcon>
              <ListItemText primary="Logout" />
            </MenuItem>
          </Menu>
        )}
      </Toolbar>
    </AppBar>
  );
};

export default Header;
